export default async function get() {
  const url = "https://cubioinfo.com/aptitude-test/api/testitems/1";
  try {
    const response = await fetch(url);
    return await response
      .clone()
      .json()
      .catch(() => response.text());
    // return await response.json();
  } catch (error) {
    console.log(error);
  }
}
